import React from 'react';
import {
  Routes,
  Route
} from 'react-router-dom';

import IndexPage from './pages/Index.js';
import UsersPage from './pages/Users.js';
import OccupationsPage from './pages/Occupations.js';
import IndustriesPage from './pages/Industries.js';
import ThemePage from './pages/Theme.js';
import EventPage from './pages/Event.js';
import CreatePage from './pages/Create.js';

function App() {
  return (
    <Routes>
      <Route path="/" element={<IndexPage />} />

      <Route path="/users" element={<UsersPage />} />

      <Route path="/occupations" element={<OccupationsPage />} />

      <Route path="/industries" element={<IndustriesPage />} />

      <Route path="/theme" element={<ThemePage />} />

      <Route path="/event" element={<EventPage />} />

      <Route path="/create" element={<CreatePage />} />
    </Routes>
  );
}

export default App;
